Here is a sample Spark job that calculates the hit rate for onsite attributed data:
```scala
import org.apache.spark.api.java.JavaRDD
import org.apache.spark.api.java.function.Function
import org.apache.spark.broadcast.Broadcast
import org.apache.spark.sql.SparkSession
import scala.collection.mutable.Map

object HitRateCalculator {
  def main(args: Array[String]): Unit = {
    val spark = SparkSession.builder().appName("HitRateCalculator").getOrCreate()

    // Load onsite attributed data
    val onsiteData: JavaRDD[(String, Long)] = spark.sparkContext.textFile("onsite_data.txt")
      .map(line => line.split(","))
      .map(arr => (arr(0), arr(1).toLong))

    // Load top frequent queries
    val topQueries: JavaRDD[String] = spark.sparkContext.textFile("top_queries.txt")

    // Broadcast top queries to all nodes
    val broadcastTopQueries: Broadcast[Array[String]] = spark.sparkContext.broadcast(topQueries.collect())

    // Initialize cache with empty map
    val cache: Map[String, (Long, Int)] = Map()

    // Process onsite data and update cache
    val processedData: JavaRDD[(String, Int)] = onsiteData.map(new Function[Tuple2[String, Long], Tuple2[String, Int]] {
      override def call(tuple: Tuple2[String, Long]): Tuple2[String, Int] = {
        val query = tuple._1
        val timestamp = tuple._2

        // Check if query is in top queries
        if (broadcastTopQueries.value.contains(query)) {
          // Check if query is in cache
          if (cache.contains(query)) {
            val (lastAccessTime, hitCount) = cache(query)

            // Check if query is still in cache (i.e., within 12 hours)
            if (timestamp - lastAccessTime <= 12 * 60 * 60 * 1000) {
              // Update hit count
              cache(query) = (timestamp, hitCount + 1)
              (query, 1) // cache hit
            } else {
              // Remove query from cache
              cache.remove(query)
              (query, 0) // cache miss
            }
          } else {
            // Add query to cache
            cache(query) = (timestamp, 1)
            (query, 0) // cache miss
          }
        } else {
          (query, -1) // not a top query
        }
      }
    })

    // Calculate hit rate
    val totalQueries = processedData.count()
    val cacheHits = processedData.filter(tuple => tuple._2 == 1).count()
    val hitRate = cacheHits.toDouble / totalQueries

    println(s"Hit rate: $hitRate")

    spark.stop()
  }
}
```
This job first loads the onsite attributed data and top frequent queries into JavaRDDs. It then broadcasts the top queries to all nodes using a broadcast variable. The cache is initialized as an empty map.

The job then processes the onsite data and updates the cache. For each query in the onsite data, it checks if the query is in the top queries and if it is in the cache. If the query is in the cache and within the 12-hour window, it increments the hit count and returns a cache hit. If the query is not in the cache or outside the 12-hour window, it adds the query to the cache and returns a cache miss. If the query is not a top query, it returns -1.

Finally, the job calculates the hit rate by dividing the number of cache hits by the total number of queries.

