```

JavaScript:
```javascript
function sortTable(n) {
  const table = document.getElementById("myTable");
  let rows, switching, i, x, y, shouldSwitch, dir, switchcount = 0;
  switching = true;
  dir = "asc";

  while (switching) {
    switching = false;
    rows = table.rows;

    for (i = 1; i < (rows.length - 1); i++) {
      shouldSwitch = false;
      x = rows[i].getElementsByTagName("TD")[n];
      y = rows[i + 1].getElementsByTagName("TD")[n];

      if (dir === "asc") {
        if (x.innerHTML.toLowerCase() > y.innerHTML.toLowerCase()) {
          shouldSwitch = true;
          break;
        }
      } else if (dir === "desc") {
        if (x.innerHTML.toLowerCase() < y.innerHTML.toLowerCase()) {
          shouldSwitch = true;
          break;
        }
      }
    }

    if (shouldSwitch) {
      rows[i].parentNode.insertBefore(rows[i + 1], rows[i]);
      switching = true;
      switchcount++;
    } else {
      if (switchcount === 0 && dir === "asc") {
        dir = "desc";
        switching = true;
      }
    }
  }
}
```

This code will sort the table rows alphanumerically when you click on the table headers. The `sortTable` function takes the column index as an argument and sorts the table based on that column. The sorting is case-insensitive and can be toggled between ascending and descending order.

 Sure, I'd be happy to help! Compiler optimizations are techniques used to improve the performance of the generated code. Here are a few popular optimization techniques:

1. Constant Propagation: This technique replaces a variable with a constant value if the variable's value is known at compile time.

Example:
```c
int foo(int x) {
  int a = 5;
  int b = a * x;
  return b;
}
```
After constant propagation, the code becomes:
```c
int foo(int x) {
  int b = 5 * x;
  return b;
}
```

2. Dead Code Elimination: This technique removes code that does not affect the program's output.

Example:
```c
int foo(int x) {
  int a = 5;
  int b = a * x;
  int c = 10;
  return b;
}
```
After dead code elimination, the code becomes:
```c
int foo(int x) {
  int b = 5 * x;
  return b;
}
```

3. Loop Unrolling: This technique increases the number of iterations in a loop and reduces the number of loop control instructions.

Example:
```c
for (int i = 0; i < 10; i++) {
  a[i] = b[i] + c[i];
}
```
After loop unrolling, the code becomes:
```c
for (int i = 0; i < 10; i += 4) {
  a[i] = b[i] + c[i];
  a[i + 1] = b[i + 1] + c[i + 1];
  a[i + 2] = b[i + 2] + c[i + 2];
  a[i + 3] = b[i + 3] + c[i + 3];
}
```

4. Function Inlining: This technique replaces a function call with the body of the function.

Example:
```c
int foo(int x) {
  return x * x;
}

int bar(int x) {
  int a = foo(x);
  return a;
}
```
After function inlining, the code becomes:
```c
int bar(int x) {
  int a = x * x;
  return a;
}
```

