Here are the JavaScript functions to pack and unpack an array of entities to an ArrayBuffer:

```javascript
function packEntities(entities) {
  const buffer = new ArrayBuffer(entities.length * 1);
  const view = new DataView(buffer);

  entities.forEach((entity, index) => {
    const byte = (entity.id << 3) | entity.size;
    view.setUint8(index, byte);
  });

  return buffer;
}

function unpackEntities(buffer) {
  const view = new DataView(buffer);
  const entities = [];

  for (let i = 0; i < view.byteLength; i++) {
    const byte = view.getUint8(i);
    const id = (byte >> 3) & 0xF;
    const size = byte & 0x7;
    entities.push({ id, size });
  }

  return entities;
}
```

These functions assume that the `entities` array is an array of objects with `id` and `size` properties. The `packEntities` function creates an ArrayBuffer with a size of `entities.length * 1` bytes, as each entity is packed into a single byte. It then iterates through the entities, packing each one into a byte by shifting the `id` 3 bits to the left and bitwise OR-ing it with the `size`.

The `unpackEntities` function does the reverse, iterating through the ArrayBuffer and extracting the `id` and `size` from each byte. It shifts the byte 3 bits to the right to extract the `id`, and uses a bitwise AND with `0x7` to extract the `size`. It then pushes an object with the extracted `id` and `size` onto the `entities` array.

