using System;
using System.Net.Http;
using System.Threading.Tasks;

namespace SteamVacBans
{
    class Program
    {
        static async Task Main(string[] args)
        {
            // Replace this with the Steam64ID of the user you want to check
            string steamId = "76561198000000000";

            // Make a request to the Steam Web API to get the user's VAC ban information
            using (HttpClient client = new HttpClient())
            {
                string url = $"http://api.steampowered.com/ISteamUser/GetPlayerBans/v1/?key={YourSteamWebApiKey}&steamids={steamId}";
                HttpResponseMessage response = await client.GetAsync(url);

                if (response.IsSuccessStatusCode)
                {
                    // Parse the response and print out the VAC ban information
                    string responseBody = await response.Content.ReadAsStringAsync();
                    dynamic data = Newtonsoft.Json.JsonConvert.DeserializeObject(responseBody);

                    if (data.players[0].NumberOfVACBans > 0)
                    {
                        Console.WriteLine($"This user has {data.players[0].NumberOfVACBans} VAC bans.");
                        Console.WriteLine($"Their last VAC ban was on {data.players[0].DaysSinceLastBan} days ago.");
                    }
                    else
                    {
                        Console.WriteLine("This user has no VAC bans.");
                    }
                }
                else
                {
                    Console.WriteLine("Failed to get VAC ban information.");
                }
            }
        }
    }
}
